import Link from 'next/link';
import "./index.css";
export default function Index() {
    return (
        <div>
            <Link href="/about">
                <a>About Page</a>
            </Link>
            <Link href="/statistics">
                <a>Stat</a>
            </Link>
            <p>Hello Next.js</p>
        </div>
    )
}
